// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";

contract HashinkDrop {

    event DropCreated(
        address owner,
        uint256 price,
        uint256 total_amount_aviable
    );

    address private owner;

    struct DropMeta {
        uint256 price;
        uint256 total_amount_aviable;
        uint256 total_amount_minted;
        bool active;
        address payable owner;
        address nft_address;
    }

    mapping (bytes32 => DropMeta) public dropmeta;

    constructor () public {
        owner = msg.sender;
    }

    function start_drop(bytes32 _id) public {
        require(msg.sender == dropmeta[_id].owner, "Caller is not owner of drop");
        dropmeta[_id].active = true;
    }

    function stop_drop(bytes32 _id) public {
        require(msg.sender == dropmeta[_id].owner, "Caller is not owner of drop");
        dropmeta[_id].active = false;
    }

    //Require that the msg.sender is the owner or approved for the contract.
    //Maybe also check to see if the contract has been granted approval for this contract
    //to excute the transfer.

    function create_drop(uint256 _amount, uint256 _price, address _nft_address, address payable _owner) public payable returns (bytes32) {
        bytes32 _id = _createOrderId(_owner, _nft_address);

        dropmeta[_id].price = _price;
        dropmeta[_id].total_amount_aviable = _amount;
        dropmeta[_id].nft_address = _nft_address;

        dropmeta[_id].total_amount_minted = 0;
        dropmeta[_id].active = true;
        dropmeta[_id].owner = _owner;

        emit DropCreated(_owner, _price, _amount);
        return (_id);
    }

    //Add to checks, one to make sure the correct amount has been sent
    //another that checks to maker sure the contract is approved to make the tansfer.
    function purchase_nft(bytes32 _id, uint256 _tokenID) public payable returns (bool) {        
        require(msg.value > 0, "No ether sent");
        require(msg.value >= dropmeta[_id].price, "Not enough ether sent");
        require(dropmeta[_id].active == true, "Drop is not active");


        IERC721(dropmeta[_id].nft_address).transferFrom(dropmeta[_id].owner, msg.sender, _tokenID);
        dropmeta[_id].owner.transfer(msg.value);
        dropmeta[_id].total_amount_minted += 1;

        if (dropmeta[_id].total_amount_minted > dropmeta[_id].total_amount_aviable) {
            dropmeta[_id].active == false;
            return (false);
        }

        return (true);
    }

    function _toBytes(uint256 x) internal pure returns (bytes memory b) {
        b = new bytes(32);
        assembly { mstore(add(b, 32), x) }
    }

    function _createOrderId(address _listerPublicKey, address _listerContractPublicKey) internal view returns (bytes32) {
        return keccak256(abi.encode(_listerPublicKey, _listerContractPublicKey, keccak256(_toBytes(block.timestamp))));
    }

}
